import React from 'react';
import logo from './logo512.png';
import './App.css';
import Popup from './Popup.js';



function App() {
  return (

    <div className="App">

      <header className="App-header">
    <p>COINFLIP</p>


        <img src={logo} className="App-logo" alt="logo" />





      </header>
    </div>
  );
}



export default App;
